import React, { Component } from "react";
import styles from "../styles/TodoList.module.scss";

class TodoList extends Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div className={styles.todolist}>
        <ul>
          <li>123</li>
          <li>456</li>
        </ul>
      </div>
    );
  }
}

export default TodoList;
